import React from "react";

export default function Dashboard() {
    return (
        <div>
            <h2>Willkommen im Dashboard!</h2>
            <button onClick={() => alert("Buchungen anzeigen")}>Meine Buchungen</button>
            <button onClick={() => alert("Neue Fahrt buchen")}>Fahrt buchen</button>
        </div>
    );
}
